I found some code in the ComputeSmallStrain.C file about volumetric strain.  I would like to ask if the first term on the right side of the formula in the code is the total strain trace, and what do the second and third terms represent?
volumetric_strain += _total_strain[_qp].trace() * _JxW[_qp] * _coord[_qp];
What do (0,0), (1,1), and (2,2) mean in the following code?
if (_volumetric_locking_correction)
{
Real trace = _total_strain[_qp].trace();
_total_strain[_qp](0, 0) += (volumetric_strain - trace) / 3.0;
_total_strain[_qp](1, 1) += (volumetric_strain - trace) / 3.0;
_total_strain[_qp](2, 2) += (volumetric_strain - trace) / 3.0;
Thanks for your reply.

I'm curious about how MOOSE assembles the nonlinear systems it needs to solve. If I provide two completely unrelated problems in the same inputdeck.i, will MOOSE combine the nonlinear equations of these two problems into one large system of equations and then call Petsc to solve it, or will it independently call Petsc to solve each problem?
In the case of two coupled problems, if I use auxvariables to decouple them (updating auxvariables with the values from the previous iteration after each linear iteration and then using auxvariables to replace the coupled variables in the next iteration), will MOOSE still combine the two problems into one large nonlinear system?
In fact, I have already attempted to use auxvariables to completely decouple the equations between different variables. I thought this would significantly reduce the memory usage of MOOSE because, after decoupling, the problem to be solved would shift from one extensive system of equations to multiple smaller systems. I believed this would greatly reduce the dimension of the coefficient matrix that needs to be stored. However, the test results revealed that after decoupling, MOOSE's memory usage remained almost unchanged, but the computation time decreased by nearly half.
If different problems are combined into one set, why does MOOSE have multiple nl_sys? My understanding is that one nonlinear system corresponds to one set of nonlinear equations.
inline void
FEProblemBase::setCurrentNonlinearSystem(const unsigned int nl_sys_num)
{
  mooseAssert(nl_sys_num < _nl.size(),
              "System number greater than the number of nonlinear systems");
  _current_nl_sys = _nl[nl_sys_num].get();
}

